import React from 'react';

function Shifts() {
  return (
    <div>
      <h2>Shift Management</h2>
      <p>This is the Shift Management system.</p>
      <div>
      <ScheduleComponent>
        <Inject services={[Day, Week, WorkWeek, Month, Agenda]} />
        <h3>Shift Schedule</h3>
      </ScheduleComponent>
      </div>
    </div>
  );
}

export default Shifts;
